<!DOCTYPE html>
<html lang="nl">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Noord-Nederland Topografie</title>
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body {
            background: #e8edf2;
            display: flex;
            flex-direction: column;
            align-items: center;
            min-height: 100vh;
            font-family: 'Segoe UI', Arial, sans-serif;
            padding: 20px;
        }

        /* ---- MENU ---- */
        #menu { text-align: center; max-width: 480px; width: 100%; }
        #menu h1 { color: #2c3e50; margin-bottom: 24px; font-size: 1.6rem; }
        .mode-btn {
            display: flex; align-items: center; gap: 12px;
            width: 100%; padding: 14px 18px; margin-bottom: 10px;
            background: #fff; border: 2px solid #3498db; border-radius: 10px;
            color: #2c3e50; font-size: 0.95rem; font-weight: 600;
            cursor: pointer; transition: all 0.2s; text-align: left;
        }
        .mode-btn:hover { background: #3498db; color: #fff; }
        .mode-num {
            display: flex; align-items: center; justify-content: center;
            width: 30px; height: 30px; min-width: 30px;
            background: #3498db; color: #fff; border-radius: 50%; font-size: 0.85rem;
        }
        .mode-btn:hover .mode-num { background: #fff; color: #3498db; }

        /* ---- QUIZ LAYOUT ---- */
        .quiz-header {
            display: flex; align-items: center; justify-content: space-between;
            width: 100%; max-width: 900px; margin-bottom: 8px;
        }
        .back-btn {
            background: none; border: none; color: #3498db;
            font-size: 1rem; cursor: pointer; font-weight: 600; padding: 4px 0;
        }
        .back-btn:hover { text-decoration: underline; }
        .score-text { color: #2c3e50; font-weight: 600; }
        .progress-bar {
            width: 100%; max-width: 900px; height: 6px;
            background: #d5dbdb; border-radius: 3px; margin-bottom: 12px; overflow: hidden;
        }
        .progress-fill {
            height: 100%; background: #3498db; border-radius: 3px;
            transition: width 0.4s ease;
        }
        .question {
            color: #2c3e50; font-size: 1.3rem; font-weight: 600;
            margin-bottom: 12px; min-height: 1.8em; text-align: center;
        }
        .question strong { color: #e74c3c; }

        /* ---- MAP ---- */
        .viewport {
            max-width: 900px; width: 100%; overflow: hidden; position: relative;
            border-radius: 10px; box-shadow: 0 4px 20px rgba(0,0,0,0.15);
        }
        .map-container {
            position: relative; margin-left: -3%; width: calc(100% + 20%);
        }
        .map-container img { width: 100%; display: block; }

        /* ---- DOTS ---- */
        .dot {
            position: absolute; width: 26px; height: 26px; border-radius: 50%;
            transform: translate(-50%, -50%); background: transparent;
            border: 2.5px solid transparent; transition: all 0.2s ease; z-index: 2;
        }
        body.mode-1 .dot { cursor: pointer; }
        body.mode-1 .dot:hover {
            background: rgba(231, 76, 60, 0.2);
            border-color: rgba(231, 76, 60, 0.6);
            transform: translate(-50%, -50%) scale(1.2);
        }
        .dot.correct {
            background: rgba(46, 204, 113, 0.4) !important;
            border-color: #27ae60 !important;
            transform: translate(-50%, -50%) scale(1.3) !important;
        }
        .dot.wrong {
            background: rgba(231, 76, 60, 0.4) !important;
            border-color: #e74c3c !important;
            transform: translate(-50%, -50%) scale(1.3) !important;
        }
        .dot.highlight {
            background: rgba(255, 215, 0, 0.4); border-color: #f1c40f;
            transform: translate(-50%, -50%) scale(1.4);
            animation: pulse-hl 1s ease-in-out infinite;
        }
        @keyframes pulse-hl {
            0%,100% { box-shadow: 0 0 0 0 rgba(241,196,15,0.6); }
            50% { box-shadow: 0 0 0 14px rgba(241,196,15,0); }
        }
        .label {
            position: absolute; transform: translate(-50%, calc(-100% - 16px));
            background: #2c3e50; color: #fff; padding: 5px 14px;
            border-radius: 6px; font-size: 14px; font-weight: 600;
            white-space: nowrap; pointer-events: none;
            opacity: 0; transition: opacity 0.35s ease; z-index: 10;
        }
        .label::after {
            content: ''; position: absolute; top: 100%; left: 50%;
            transform: translateX(-50%); border: 6px solid transparent;
            border-top-color: #2c3e50;
        }
        .label.below { transform: translate(-50%, 20px); }
        .label.below::after {
            top: auto; bottom: 100%;
            border-top-color: transparent; border-bottom-color: #2c3e50;
        }
        .label.visible { opacity: 1; }

        /* ---- CHOICES (mode 2) ---- */
        .choices {
            display: flex; gap: 10px; justify-content: center;
            flex-wrap: wrap; margin-top: 14px; max-width: 900px;
        }
        .choice-btn {
            padding: 10px 24px; background: #fff; border: 2px solid #3498db;
            border-radius: 8px; color: #2c3e50; font-size: 1rem;
            font-weight: 600; cursor: pointer; transition: all 0.15s;
        }
        .choice-btn:hover { background: #ebf5fb; }
        .choice-btn.correct { background: #2ecc71; border-color: #27ae60; color: #fff; }
        .choice-btn.wrong { background: #e74c3c; border-color: #c0392b; color: #fff; }
        .choice-btn:disabled { cursor: default; opacity: 0.7; }

        /* ---- TYPE INPUT (mode 3) ---- */
        .type-area {
            display: flex; gap: 10px; justify-content: center;
            margin-top: 14px; max-width: 900px;
        }
        .type-input {
            padding: 10px 16px; border: 2px solid #bdc3c7; border-radius: 8px;
            font-size: 1rem; width: 250px; outline: none; transition: border-color 0.2s;
        }
        .type-input:focus { border-color: #3498db; }
        .type-input.correct { border-color: #27ae60; background: #eafaf1; }
        .type-input.wrong { border-color: #e74c3c; background: #fdedec; }
        .submit-btn {
            padding: 10px 20px; background: #3498db; color: #fff; border: none;
            border-radius: 8px; font-size: 1rem; font-weight: 600; cursor: pointer;
        }
        .submit-btn:hover { background: #2980b9; }

        /* ---- PROVINCE BUTTONS (mode 4) ---- */
        .province-area {
            max-width: 420px; width: 100%; margin-top: 10px;
        }
        .province-btn {
            display: block; width: 100%; padding: 18px;
            margin-bottom: 10px; border: 3px solid; border-radius: 12px;
            font-size: 1.15rem; font-weight: 700; cursor: pointer; transition: all 0.15s;
        }
        .prov-friesland { background: #e8f5e9; border-color: #4CAF50; color: #2e7d32; }
        .prov-groningen { background: #fff3e0; border-color: #FF9800; color: #e65100; }
        .prov-drenthe   { background: #f3e5f5; border-color: #9C27B0; color: #6a1b9a; }
        .prov-friesland:hover { background: #c8e6c9; }
        .prov-groningen:hover { background: #ffe0b2; }
        .prov-drenthe:hover   { background: #e1bee7; }
        .province-btn.correct { background: #2ecc71 !important; border-color: #27ae60 !important; color: #fff !important; }
        .province-btn.wrong   { background: #e74c3c !important; border-color: #c0392b !important; color: #fff !important; }
        .province-btn:disabled { cursor: default; }

        /* ---- RESULTS ---- */
        .results { text-align: center; max-width: 480px; width: 100%; }
        .results h2 { color: #2c3e50; margin-bottom: 12px; font-size: 1.5rem; }
        .final-score { font-size: 3rem; color: #3498db; font-weight: 700; margin-bottom: 6px; }
        .final-pct { font-size: 1.1rem; color: #666; margin-bottom: 20px; }
        .result-btns { display: flex; gap: 10px; justify-content: center; }
        .result-btns button {
            padding: 12px 28px; background: #3498db; color: #fff; border: none;
            border-radius: 8px; font-size: 1rem; font-weight: 600; cursor: pointer;
        }
        .result-btns button:hover { background: #2980b9; }
        .result-btns button.secondary { background: #95a5a6; }
        .result-btns button.secondary:hover { background: #7f8c8d; }

        .hidden { display: none !important; }

        /* ---- MOBILE ---- */
        @media (max-width: 640px) {
            body { padding: 10px; }
            .viewport { position: relative; touch-action: manipulation; }
            .map-container {
                transform: scale(2.2);
                transform-origin: 57% 14%;
            }
            .label { font-size: 7px; padding: 2px 6px; border-radius: 4px; }
            .label::after { border-width: 4px; }
            .label.below { transform: translate(-50%, 12px); }
            .question { font-size: 1.1rem; margin-bottom: 8px; }
            .choices { gap: 8px; margin-top: 10px; }
            .choice-btn { padding: 12px 16px; font-size: 0.9rem; flex: 1 1 40%; }
            .type-input { width: 180px; }
            .province-btn { padding: 14px; font-size: 1rem; }
            .result-btns { flex-direction: column; }
            .result-btns button { width: 100%; }
        }
    </style>
</head>

    <button class="mode-btn" onclick="startQuiz(1)">

    <button class="mode-btn" onclick="startQuiz(3)">
        <span class="mode-num">3</span> Typ de naam
    </button>
    <button class="mode-btn" onclick="startQuiz(4)">

    </button>
</div>

        </div>
    </div>

    <div class="choices hidden" id="choices"></div>

    <div class="type-area hidden" id="typeArea">
        <input type="text" class="type-input" id="typeInput" placeholder="Typ de naam..." autocomplete="off" spellcheck="false" />
        <button class="submit-btn" id="submitBtn" onclick="submitTyped()">OK</button>
    </div>

    <div class="province-area hidden" id="provinceArea">
        <button class="province-btn prov-friesland" onclick="checkProvince('Friesland',this)">Friesland</button>
        <button class="province-btn prov-groningen" onclick="checkProvince('Groningen',this)">Groningen</button>
        <button class="province-btn prov-drenthe" onclick="checkProvince('Drenthe',this)">Drenthe</button>
    </div>
</div>

<!-- RESULTS -->
<div id="results" class="hidden results">
    <h2>Klaar!</h2>
    <div class="final-score" id="finalScore"></div>
    <div class="final-pct" id="finalPct"></div>
    <div class="result-btns">
        <button onclick="startQuiz(currentMode)">Opnieuw</button>
        <button class="secondary" onclick="goToMenu()">Menu</button>
    </div>
</div>

<script>
const locations = [
    { name: "Vlieland",        x: 41.9, y: 12.3, prov: "Friesland", below: true },
    { name: "Terschelling",    x: 47.7, y:  9.4, prov: "Friesland", below: true },
    { name: "Ameland",         x: 53.6, y:  8.3, prov: "Friesland", below: true },
    { name: "Schiermonnikoog", x: 60.0, y:  7.4, prov: "Friesland", below: true },
    { name: "Harlingen",       x: 48.5, y: 13.7, prov: "Friesland" },
    { name: "Leeuwarden",      x: 54.2, y: 13.0, prov: "Friesland" },
    { name: "Dokkum",          x: 56.9, y: 10.4, prov: "Friesland" },
    { name: "Sneek",           x: 52.3, y: 16.2, prov: "Friesland" },
    { name: "Drachten",        x: 58.6, y: 14.6, prov: "Friesland" },
    { name: "Heerenveen",      x: 56.4, y: 17.7, prov: "Friesland" },
    { name: "Eemshaven",       x: 67.9, y:  8.2, prov: "Groningen" },
    { name: "Delfzijl",        x: 70.5, y: 10.3, prov: "Groningen" },
    { name: "Groningen",       x: 65.6, y: 12.5, prov: "Groningen" },
    { name: "Slochteren",      x: 68.7, y: 12.7, prov: "Groningen" },
    { name: "Veendam",         x: 69.9, y: 14.6, prov: "Groningen" },
    { name: "Assen",           x: 65.9, y: 16.6, prov: "Drenthe" },
    { name: "Meppel",          x: 60.7, y: 22.4, prov: "Drenthe" },
    { name: "Hoogeveen",       x: 65.1, y: 21.9, prov: "Drenthe" },
    { name: "Emmen",           x: 70.9, y: 20.9, prov: "Drenthe" },
    { name: "Schoonebeek",     x: 70.7, y: 22.8, prov: "Drenthe" },
];

let currentMode = 0, questions = [], currentQ = 0, score = 0, waiting = false;
const dotEls = [], labelEls = [];
const container = document.getElementById('mapContainer');
const viewport = document.getElementById('viewport');
const img = document.getElementById('mapImage');

// Build dots
locations.forEach((loc, i) => {
    const dot = document.createElement('div');
    dot.className = 'dot';
    dot.style.left = loc.x + '%';
    dot.style.top = loc.y + '%';
    dot.addEventListener('click', e => { e.stopPropagation(); handleDotClick(i); });

    const lbl = document.createElement('div');
    lbl.className = 'label' + (loc.below ? ' below' : '');
    lbl.style.left = loc.x + '%';
    lbl.style.top = loc.y + '%';
    lbl.textContent = loc.name;

    container.appendChild(dot);
    container.appendChild(lbl);
    dotEls.push(dot);
    labelEls.push(lbl);
});

// Fallback: click near a dot in mode 1
container.addEventListener('click', e => {
    if (currentMode !== 1 || waiting) return;
    const rect = img.getBoundingClientRect();
    const xP = (e.clientX - rect.left) / rect.width * 100;
    const yP = (e.clientY - rect.top) / rect.height * 100;
    let best = -1, bestD = Infinity;
    locations.forEach((l, i) => {
        const d = Math.hypot(l.x - xP, l.y - yP);
        if (d < bestD) { bestD = d; best = i; }
    });
    if (best >= 0 && bestD < 3) handleDotClick(best);
});

function clipViewport() {
    if (img.offsetHeight > 0) {
        viewport.style.maxHeight = (img.offsetHeight * 0.61) + 'px';
    }
}

function shuffle(a) {
    a = [...a];
    for (let i = a.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [a[i], a[j]] = [a[j], a[i]];
    }
    return a;
}

function goToMenu() {
    document.getElementById('menu').classList.remove('hidden');
    document.getElementById('quiz').classList.add('hidden');
    document.getElementById('results').classList.add('hidden');
    document.body.className = '';
    clearDots();
}

function clearDots() {
    dotEls.forEach(d => d.className = 'dot');
    labelEls.forEach(l => l.classList.remove('visible'));
}

function updateUI() {
    document.getElementById('scoreText').textContent = score + ' goed van ' + currentQ;
    document.getElementById('progressFill').style.width = (currentQ / questions.length * 100) + '%';
}

/* ---- START ---- */
function startQuiz(mode) {
    currentMode = mode;
    questions = shuffle(locations.map((_, i) => i));
    currentQ = 0; score = 0; waiting = false;

    document.getElementById('menu').classList.add('hidden');
    document.getElementById('results').classList.add('hidden');
    document.getElementById('quiz').classList.remove('hidden');
    requestAnimationFrame(clipViewport);

    document.body.className = 'mode-' + mode;

    viewport.classList.toggle('hidden', mode === 4);
    document.getElementById('choices').classList.add('hidden');
    document.getElementById('typeArea').classList.add('hidden');
    document.getElementById('provinceArea').classList.toggle('hidden', mode !== 4);

    if (mode === 2) document.getElementById('choices').classList.remove('hidden');
    if (mode === 3) document.getElementById('typeArea').classList.remove('hidden');

    updateUI();
    showQuestion();
}

/* ---- SHOW QUESTION ---- */
function showQuestion() {
    if (currentQ >= questions.length) { endQuiz(); return; }
    clearDots(); waiting = false;
    const idx = questions[currentQ];
    const loc = locations[idx];

    if (currentMode === 1) {
        document.getElementById('question').innerHTML = 'Waar ligt <strong>' + loc.name + '</strong>?';
    }
    else if (currentMode === 2) {
        dotEls[idx].classList.add('highlight');
        document.getElementById('question').textContent = 'Welke plaats is dit?';
        buildChoices(idx);
    }
    else if (currentMode === 3) {
        dotEls[idx].classList.add('highlight');
        document.getElementById('question').textContent = 'Welke plaats is dit?';
        const inp = document.getElementById('typeInput');
        inp.value = ''; inp.className = 'type-input'; inp.focus();
    }
    else if (currentMode === 4) {
        document.getElementById('question').innerHTML = 'In welke provincie ligt <strong>' + loc.name + '</strong>?';
        document.querySelectorAll('.province-btn').forEach(b => {
            b.classList.remove('correct', 'wrong'); b.disabled = false;
        });
    }
}

/* ---- MODE 1: click location ---- */
function handleDotClick(i) {
    if (currentMode !== 1 || waiting) return;
    waiting = true;
    const correct = questions[currentQ];
    if (i === correct) {
        score++;
        dotEls[i].classList.add('correct');
        labelEls[i].classList.add('visible');
        advance(1200);
    } else {
        dotEls[i].classList.add('wrong');
        dotEls[correct].classList.add('correct');
        labelEls[correct].classList.add('visible');
        advance(2000);
    }
}

/* ---- MODE 2: multiple choice ---- */
function buildChoices(correctIdx) {
    const el = document.getElementById('choices');
    el.innerHTML = '';
    let wrong = shuffle(locations.map((_, i) => i).filter(i => i !== correctIdx)).slice(0, 3);
    shuffle([correctIdx, ...wrong]).forEach(optIdx => {
        const btn = document.createElement('button');
        btn.className = 'choice-btn';
        btn.textContent = locations[optIdx].name;
        btn.onclick = () => checkChoice(optIdx, correctIdx, btn);
        el.appendChild(btn);
    });
}

function checkChoice(chosen, correct, btn) {
    if (waiting) return;
    waiting = true;
    const allBtns = document.querySelectorAll('.choice-btn');
    allBtns.forEach(b => b.disabled = true);
    if (chosen === correct) {
        score++;
        btn.classList.add('correct');
        labelEls[correct].classList.add('visible');
        advance(1200);
    } else {
        btn.classList.add('wrong');
        allBtns.forEach(b => { if (b.textContent === locations[correct].name) b.classList.add('correct'); });
        labelEls[correct].classList.add('visible');
        advance(2000);
    }
}

/* ---- MODE 3: type name ---- */
function submitTyped() {
    if (waiting) return;
    const inp = document.getElementById('typeInput');
    const typed = inp.value.trim().toLowerCase();
    if (!typed) return;
    waiting = true;
    const correct = questions[currentQ];
    const name = locations[correct].name.toLowerCase();
    if (typed === name) {
        score++;
        inp.classList.add('correct');
        labelEls[correct].classList.add('visible');
        advance(1200);
    } else {
        inp.classList.add('wrong');
        labelEls[correct].classList.add('visible');
        setTimeout(() => { inp.value = locations[correct].name; }, 400);
        advance(2500);
    }
}
document.getElementById('typeInput').addEventListener('keydown', e => {
    if (e.key === 'Enter') submitTyped();
});

/* ---- MODE 4: province ---- */
function checkProvince(chosen, btn) {
    if (waiting) return;
    waiting = true;
    const correct = locations[questions[currentQ]].prov;
    const allBtns = document.querySelectorAll('.province-btn');
    allBtns.forEach(b => b.disabled = true);
    if (chosen === correct) {
        score++;
        btn.classList.add('correct');
        advance(1000);
    } else {
        btn.classList.add('wrong');
        allBtns.forEach(b => { if (b.textContent === correct) b.classList.add('correct'); });
        advance(2000);
    }
}

/* ---- ADVANCE / END ---- */
function advance(delay) {
    currentQ++;
    updateUI();
    setTimeout(showQuestion, delay);
}

function endQuiz() {
    document.getElementById('quiz').classList.add('hidden');
    document.getElementById('results').classList.remove('hidden');
    const pct = Math.round(score / questions.length * 100);
    document.getElementById('finalScore').textContent = score + ' / ' + questions.length;
    document.getElementById('finalPct').textContent = pct + '%' + (pct === 100 ? '  Perfect!' : pct >= 80 ? '  Goed gedaan!' : '');
}
</script>
</body>
</html>
